          - 'Day unknown. '
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - 'I''ve been unsuccessful thus far in navigating this '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 1
          parameters:
          - hellish cave.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - Despite the rails--
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - Despite the stone markings I've tried to leave--
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - 'Despite carefully recording my passages through this '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 1
          parameters:
          - place--
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - 'I''m baffled. '
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - Utterly and completely...
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - 'I felt relocating here would be a leap towards '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 1
          parameters:
          - progress to finding my way home.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - 'Instead I feel I''ve entrenched myself in the prison of '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 1
          parameters:
          - this place.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
