        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Progress has once again teased me with her coy '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - 'seduction. '
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'In my continual stumbling through the labyrinth, I '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - 'found nestled into the wall, a door imprinted upon the '
        - !ruby/object:RPG::EventCommand
