          indent: 2
          parameters:
          - stone in a glowing light.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'Beyond its threshold, a world of glittering, static blue '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - and stars.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - I do not know what awaits me in the world.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - I do know that I am weak.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'I am thin, and exhausted-- physically, mentally, '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - emotionally.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'I cannot refuse the chance that this will lead me to '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 2
          parameters:
          - safety.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'But there is no promise in those jilted lands, and I do '
        - !ruby/object:RPG::EventCommand
          code: 401
