          code: 101
          indent: 2
          parameters:
          - Please apologize to my little girl, Snow, for me.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 2
          parameters:
          - 'And her gift-- I would ask someone look after the '
        - !ruby/object:RPG::EventCommand
          code: 401
